-- Initiating the database
USE [EventSphere Database];


-- 5.Employee



-- Inserting more employees from the AdventureWorks Database

	organization_ID,
	first_name,
    last_name,
	job_title,
    email
)
SELECT
    -- Selecting a random organization_ID that exists in the Organization table
    O.organization_ID,
	P.FirstName,
	P.LastName,
	EM.JobTitle,
	E.EmailAddress
FROM 
    [AdventureWorks2022].[HumanResources].[Employee] EM
JOIN 
    [AdventureWorks2022].[Person].[Person] P ON P.BusinessEntityID = EM.BusinessEntityID
JOIN 
    [AdventureWorks2022].[Person].[EmailAddress] E ON E.BusinessEntityID = EM.BusinessEntityID
JOIN 
    [EventSphere Database].[dbo].[Organization] O ON 1 = 1 -- Randomly joining with the Organization table to assign existing organization_IDs
ORDER BY 
    NEWID(); -- Randomly shuffle the results to ensure random assignment




-- There were multiple employees with same first name, last name, job title and email but with different id,(apparently the data that I've inserted from the AdventureWorks database). 
-- Keeping only one of these records for each employee, I removed the rest.

WITH CTE AS
(
SELECT [first_name],
	[last_name],
	[job_title],
	[email],
	employee_count = COUNT([employee_ID]) OVER(PARTITION BY [first_name],[last_name],[job_title],[email]),
	rn = ROW_NUMBER() OVER(PARTITION BY [first_name],[last_name],[job_title],[email] ORDER BY [employee_ID]) -- Row number gives ranks to each employee with the same information
FROM [dbo].[Employee]
)
DELETE
FROM CTE
WHERE rn > 1 -- keeping only one record (of rank 1) and removing the rest


SELECT * FROM Employee;